import React from 'react';
import Todo from './todo';
const todolist = ({ Submitdata, setSubmitdata, Status }) => {
	return (
		<>
			<div className="todo_list">
				{Submitdata.map(index => (
					<Todo
						key={index.id}
						todo={index}
						setSubmitdata={setSubmitdata}
						todos={Submitdata}
						Status={Status}
					/>
				))}
			</div>
		</>
	);
};

export default todolist;
